import React from "react";
import VideojuegoLista from "../Videojuego/VideojuegoLista";

const CatalogoItem = () => {
    return(
        <div className="col-lg-8 row-lg-1">
            <VideojuegoLista />
        </div>
    );
};

export default CatalogoItem;
